import Link from 'next/link';
import css from "./Header.css"

const linkStyle = {
  marginRight: 15
}

const Header = (props) => (

      <div className={css.header}>
      <Link href="https://reactjs.org/docs/fragments.html">
      <a>
        <img className={css.headerImage} src={props.imageUrl}/>
        </a>
      </Link>
      </div>

)

export default Header
